import React from 'react'
import Post from './Post'

const Posts = ({posts, ...rest}) => {
  if (!posts.length) {
    return <p className="text-center">No posts...</p>
  }
  return posts.map(post => <Post post={post} key={post} />)
}

export default Posts;
